(29, 1, 'product', '{\"name\":\"Test product\",\"model\":\"Botble\\\\Ecommerce\\\\Models\\\\Product\",\"slug\":\"test-product\",\"slug_id\":\"50\",\"is_slug_editable\":\"1\",\"description\":\"<p>Short Hooded Coat features a straight body, large pockets with button flaps, ventilation air holes, and a string detail along the hemline.<\\/p><p><img style=\\\"height:15px;\\\" src=\\\"\\/storage\\/general\\/clock.png\\\" alt=\\\"icon\\\"> &nbsp;1 Year AL Jazeera Brand Warranty<\\/p><p><img style=\\\"height:15px;\\\" src=\\\"\\/storage\\/general\\/paper-plane.png\\\" alt=\\\"icon\\\"> &nbsp; 30 Day Return Policy<\\/p><p><img style=\\\"height:15px;\\\" src=\\\"\\/storage\\/general\\/credit-card.png\\\" alt=\\\"icon\\\"> &nbsp;Cash on Delivery available<\\/p>\",\"content\":\"<p>Short Hooded Coat features a straight body, large pockets with button flaps, ventilation air holes, and a string detail along the hemline. The style is completed with a drawstring hood, featuring Rains\\u2019 signature built-in cap. Made from waterproof, matte PU, this lightweight unisex rain jacket is an ode to nostalgia through its classic silhouette and utilitarian design details.<\\/p><p>- Casual unisex fit<\\/p><p>- 64% polyester, 36% polyurethane<\\/p><p>- Water column pressure: 4000 mm<\\/p><p>- Model is 187cm tall and wearing a size S \\/ M<\\/p><p>- Unisex fit<\\/p><p>- Drawstring hood with built-in cap<\\/p><p>- Front placket with snap buttons<\\/p><p>- Ventilation under armpit<\\/p><p>- Adjustable cuffs<\\/p><p>- Double welted front pockets<\\/p><p>- Adjustable elastic string at hempen<\\/p><p>- Ultrasonically welded seams<\\/p><p>This is a unisex item, please check our clothing &amp; footwear sizing guide for specific Rains jacket sizing information. RAINS comes from the rainy nation of Denmark at the edge of the European continent, close to the ocean and with prevailing westerly winds; all factors that contribute to an average of 121 rain days each year. Arising from these rainy weather conditions comes the attitude that a quick rain shower may be beautiful, as well as moody- but first and foremost requires the right outfit. Rains focus on the whole experience of going outside on rainy days, issuing an invitation to explore even in the most mercurial weather.<\\/p>\",\"images\":[null,\"products\\/24.jpg\",\"products\\/24-1.jpg\"],\"product_type\":\"physical\",\"specification_table_id\":\"1\",\"specification_attributes\":{\"1\":{\"value\":null,\"order\":\"0\"},\"2\":{\"value\":null,\"order\":\"1\"},\"3\":{\"value\":null,\"order\":\"2\"},\"4\":{\"value\":null,\"order\":\"0\"},\"5\":{\"value\":null,\"order\":\"1\"}},\"sale_type\":\"0\",\"sku\":\"MK-141-A1\",\"price\":\"20\",\"sale_price\":\"15\",\"start_date\":null,\"end_date\":null,\"cost_per_item\":null,\"product_id\":\"24\",\"barcode\":null,\"with_storehouse_management\":\"1\",\"quantity\":\"20\",\"allow_checkout_when_out_of_stock\":\"0\",\"stock_status\":\"in_stock\",\"generate_license_code\":\"0\",\"is_added_attributes\":\"1\",\"added_attributes\":{\"3\":\"11\"},\"has_product_options\":\"1\",\"related_products\":\"1\",\"cross_sale_products\":{\"1\":{\"id\":\"1\",\"is_variant\":\"0\",\"price\":\"0.00\",\"price_type\":\"fixed\"}},\"faq_schema_config\":[[{\"key\":\"question\",\"value\":null},{\"key\":\"answer\",\"value\":null}]],\"selected_existing_faqs\":[\"9\",\"10\"],\"seo_meta\":{\"seo_title\":null,\"seo_description\":null,\"index\":\"index\"},\"seo_meta_image\":null,\"language\":\"hy\",\"layout\":null,\"is_popular\":\"0\",\"status\":\"published\",\"is_featured\":\"1\",\"categories\":[\"10\",\"2\",\"4\",\"8\"],\"brand_id\":\"7\",\"image\":\"products\\/24.jpg\",\"product_collections\":[\"1\"],\"product_labels\":[\"1\"],\"minimum_order_quantity\":\"0\",\"maximum_order_quantity\":\"0\",\"tag\":\"[{\\\"value\\\":\\\"Bags\\\"},{\\\"value\\\":\\\"Shoes\\\"},{\\\"value\\\":\\\"Clothes\\\"}]\",\"submitter\":\"apply\"}', 'updated', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like