(1, 'Seeds of Change Organic Quinoe', '<p>Short Hooded Coat features a straight body, large pockets with button flaps, ventilation air holes, and a string detail along the hemline.</p><p><img style=\"height:15px;\" src=\"/storage/general/clock.png\" alt=\"icon\">  1 Year AL Jazeera Brand Warranty</p><p><img style=\"height:15px;\" src=\"/storage/general/paper-plane.png\" alt=\"icon\">   30 Day Return Policy</p><p><img style=\"height:15px;\" src=\"/storage/general/credit-card.png\" alt=\"icon\">  Cash on Delivery available</p>', '<p>Short Hooded Coat features a straight body, large pockets with button flaps, ventilation air holes, and a string detail along the hemline. The style is completed with a drawstring hood, featuring Rains’ signature built-in cap. Made from waterproof, matte PU, this lightweight unisex rain jacket is an ode to nostalgia through its classic silhouette and utilitarian design details.</p><p>- Casual unisex fit</p><p>- 64% polyester, 36% polyurethane</p><p>- Water column pressure: 4000 mm</p><p>- Model is 187cm tall and wearing a size S / M</p><p>- Unisex fit</p><p>- Drawstring hood with built-in cap</p><p>- Front placket with snap buttons</p><p>- Ventilation under armpit</p><p>- Adjustable cuffs</p><p>- Double welted front pockets</p><p>- Adjustable elastic string at hempen</p><p>- Ultrasonically welded seams</p><p>This is a unisex item, please check our clothing &amp; footwear sizing guide for specific Rains jacket sizing information. RAINS comes from the rainy nation of Denmark at the edge of the European continent, close to the ocean and with prevailing westerly winds; all factors that contribute to an average of 121 rain days each year. Arising from these rainy weather conditions comes the attitude that a quick rain shower may be beautiful, as well as moody- but first and foremost requires the right outfit. Rains focus on the whole experience of going outside on rainy days, issuing an invitation to explore even in the most mercurial weather.<