 pockets<\\/p>\\r\\n\\r\\n<p>- Adjustable elastic string at hempen<\\/p>\\r\\n\\r\\n<p>- Ultrasonically welded seams<\\/p>\\r\\n\\r\\n<p>This is a unisex item, please check our clothing & footwear sizing guide for specific Rains jacket sizing\\r\\n    information. RAINS comes from the rainy nation of Denmark at the edge of the European continent, close to the ocean\\r\\n    and with prevailing westerly winds; all factors that contribute to an average of 121 rain days each year. Arising\\r\\n    from these rainy weather conditions comes the attitude that a quick rain shower may be beautiful, as well as moody-\\r\\n    but first and foremost requires the right outfit. Rains focus on the whole experience of going outside on rainy\\r\\n    days, issuing an invitation to explore even in the most mercurial weather.<\\/p>\\r\\n\",\"status\":{\"value\":\"published\",\"label\":\"Published\"},\"images\":[\"products\\/1.jpg\",\"products\\/1-1.jpg\"],\"video_media\":null,\"sku\":\"PW-113\",\"order\":0,\"quantity\":11,\"allow_checkout_when_out_of_stock\":false,\"with_storehouse_management\":true,\"is_featured\":true,\"brand_id\":7,\"is_variation\":0,\"sale_type\":0,\"price\":2483,\"sale_price\":88,\"start_date\":null,\"end_date\":null,\"length\":13,\"wide\":11,\"height\":12,\"weight\":698,\"tax_id\":null,\"views\":72004,\"created_at\":\"2024-10-31T20:48:30.000000Z\",\"updated_at\":\"2024-10-31T20:48:45.000000Z\",\"stock_status\":{\"value\":\"in_stock\",\"label\":\"In stock\"},\"created_by_id\":0,\"created_by_type\":\"Botble\\\\ACL\\\\Models\\\\User\",\"image\":\"products\\/1.jpg\",\"product_type\":{\"value\":\"physical\",\"label\":\"Physical\"},\"barcode\":null,\"cost_per_item\":null,\"generate_license_code\":false,\"minimum_order_quantity\":0,\"maximum_order_quantity\":0,\"notify_attachment_updated\":false,\"specification_table_id\":2,\"store_id\":1,\"approved_by\":0,\"original_price\":58.96,\"front_sale_price\":58.96,\"translations\":[]}}]}],\"address\":{\"name\":\"Nalbandyan\